// compile time checking if there is correct number of agents
#if defined(SINGLE_PENDULUM)
#define NUM_AGENTS 1
#elif defined(DOUBLE_PENDULUM)
#define NUM_AGENTS 4
#endif

#define ARRAY_SIZE(arr) (sizeof(arr) / sizeof(arr[0]))

#define VALIDATE_AGENTS_ARRAY(arr) \
        static_assert(ARRAY_SIZE(arr) == NUM_AGENTS, \
        "Array size mismatch: " \
        "SINGLE_PENDULUM requires 1 agent, " \
        "DOUBLE_PENDULUM requires 4 agents")

VALIDATE_AGENTS_ARRAY(agents);

